import React from "react";
import Nv from "./topnav";
import prof from "./profile.png";
import Ham from "./ham";
import { useLocation } from "react-router-dom";

const Profile = () => {
    const locc = useLocation();
    return (
    <div>
         {window.innerWidth < 450 ? <Ham userid={locc.state.userid} uuid={locc.state.uuid} /> 
         : 
         <Nv userid={locc.state.userid} uuid={locc.state.uuid}/>}
        <div className="m-[50px]">
            <div className="grid grid-cols-3 gap-4">
                <div className="col-span-1 row-span-1 p-4 rounded-md bg-[#e6e9f0]">
                    <img src={prof} className="m-auto h-[150px]"/>
                    <h1 className="m-[5px] whitespace-nowrap font-bold">Ojas Sharma</h1>
                    <center><h6 className="font-medium">Aspiring devoloper</h6></center>
                </div>
                <div className="col-span-2 row-span-2 
                 bg-[#e6e9f0] rounded-md p-[50px]">
                    <p>Full Name  Ojas Sharma</p>
                    <p>Email : ojassharma2547@gmail.com</p>
                    <p></p>
                </div>
                <div className="bg-[#e6e9f0] h-[200px] row-span-1 col-span-1 rounded-md
                 p-4">
                    fdsfs
                </div>
            </div>
            <div>

            </div>
        </div>
    </div>
    );
}

export default Profile;
